// JobsPage.js
import React, { useState, useEffect } from 'react';
import './JobsPage.css';

const JobsPage = () => {
  const [jobs, setJobs] = useState([
    {
      id: 1,
      ship: 'Unknown Ship',
      component: 'engine',
      type: 'inspection',
      priority: 'high',
      status: 'in progress',
      startDate: 'May 12, 2025 01:38',
      assignedTo: 'Unassigned'
    }
    // Add more jobs as needed
  ]);
  const [filterShip, setFilterShip] = useState('All Ships');
  const [filterStatus, setFilterStatus] = useState('All Statuses');
  const [filterPriority, setFilterPriority] = useState('All Priorities');

  const updateJobStatus = async (jobId, newStatus) => {
    try {
      // In a real app, you would make an API call here
      // const response = await fetch(`/api/jobs/${jobId}`, {
      //   method: 'PATCH',
      //   headers: { 'Content-Type': 'application/json' },
      //   body: JSON.stringify({ status: newStatus })
      // });
      // const data = await response.json();

      // For demo purposes, we'll just update the local state
      setJobs(jobs.map(job => 
        job.id === jobId ? { ...job, status: newStatus } : job
      ));
      
      console.log(`Job ${jobId} status updated to ${newStatus}`);
    } catch (error) {
      console.error('Error updating job status:', error);
    }
  };

  const filteredJobs = jobs.filter(job => {
    return (
      (filterShip === 'All Ships' || job.ship === filterShip) &&
      (filterStatus === 'All Statuses' || job.status === filterStatus) &&
      (filterPriority === 'All Priorities' || job.priority === filterPriority)
    );
  });

  return (
    <div className="jobs-page">
      <h1>ShipMaster</h1>
      <div className="sidebar">
        <h2>Dashboard</h2>
        <ul>
          <li>Ship Management</li>
          <li className="active">Jobs</li>
          <li>Components</li>
          <li>Dark Mode</li>
          <li>Logout</li>
        </ul>
      </div>

      <div className="main-content">
        <div className="filters">
          <div className="filter-group">
            <label>Filter by Ship:</label>
            <select value={filterShip} onChange={(e) => setFilterShip(e.target.value)}>
              <option value="All Ships">All Ships</option>
              <option value="Unknown Ship">Unknown Ship</option>
              {/* Add more ships as needed */}
            </select>
          </div>

          <div className="filter-group">
            <label>Filter by Status:</label>
            <select value={filterStatus} onChange={(e) => setFilterStatus(e.target.value)}>
              <option value="All Statuses">All Statuses</option>
              <option value="in progress">In Progress</option>
              <option value="completed">Completed</option>
              {/* Add more statuses as needed */}
            </select>
          </div>

          <div className="filter-group">
            <label>Filter by Priority:</label>
            <select value={filterPriority} onChange={(e) => setFilterPriority(e.target.value)}>
              <option value="All Priorities">All Priorities</option>
              <option value="high">High</option>
              <option value="medium">Medium</option>
              <option value="low">Low</option>
            </select>
          </div>
        </div>

        <JobsTable jobs={filteredJobs} updateJobStatus={updateJobStatus} />
      </div>
    </div>
  );
};

const JobsTable = ({ jobs, updateJobStatus }) => {
  const handleComplete = async (jobId) => {
    await updateJobStatus(jobId, 'completed');
  };

  return (
    <table className="jobs-table">
      <thead>
        <tr>
          <th>Job ID</th>
          <th>Ship</th>
          <th>Component</th>
          <th>Type</th>
          <th>Priority</th>
          <th>Status</th>
          <th>Start Date</th>
          <th>Assigned To</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {jobs.map(job => (
          <tr key={job.id}>
            <td>#{job.id}</td>
            <td>{job.ship}</td>
            <td>{job.component}</td>
            <td>{job.type}</td>
            <td className={`priority-${job.priority}`}>{job.priority}</td>
            <td>{job.status}</td>
            <td>{job.startDate}</td>
            <td>{job.assignedTo}</td>
            <td>
              <button className="view-btn">View</button>
              <button className="edit-btn">Edit</button>
              {job.status !== 'completed' && (
                <button 
                  className="complete-btn"
                  onClick={() => handleComplete(job.id)}
                >
                  Complete
                </button>
              )}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default JobsPage;
